import "./Post.css";

function Post() {
  return (
    <div className="post">
      <div className="postWrapper">
        <div className="postTop">top</div>
        <div className="postCenter">center</div>
        <div className="postBottom">bottom</div>
      </div>
    </div>
  );
}

export default Post;
